@SpringBootApplication
@EnableOAuth2Client
public class CEIPSocialApplication {

    public static final String detect = "https://aip.baidubce.com/rest/2.0/face/v1/detect";


    public static void main(String[] args) {
        ConfigurableApplicationContext run = SpringApplication.run(CEIPSocialApplication.class, args);
        OAuth2RestTemplate restTemplate = run.getBean(OAuth2RestTemplate.class);
        Map<String, Object> params = new HashMap<>();
        String str = "";
        try {
            str = new String(encode(FileCopyUtils.copyToByteArray(new File("511028195910067715.jpg"))));
        } catch (IOException e) {
            e.printStackTrace();
        }
       //params.put("image", "");
        MultiValueMap<String, String> request = new LinkedMultiValueMap<>();
        List<String> values = new ArrayList<>();
        //values.add("");

        values.add(str);
        request.put("image", values);
        request.add("face_fields", "age,expression,landmark");
        //request.add("face_fields", "expression");
        ResponseEntity<String> stringResponseEntity = restTemplate.postForEntity(detect, request, String.class, params);
        String body = stringResponseEntity.getBody();
        System.out.println(body);


    }


    @Bean
    public OAuth2RestTemplate oAuth2RestTemplate(OAuth2ProtectedResourceDetails resource, OAuth2ClientContext context) {
        return new OAuth2RestTemplate(resource, context);
    }




}
